import React ,{ Component }  from 'react';
import Header from './header';
import '../css/interact.css';
import Footer from './footer';
//import {Navbar,Nav} from 'react-bootstrap';
import moment from 'moment';
import ReactTimeslotCalendar from 'react-timeslot-calendar-k';

class interact extends Component{
  
  
  componentDidMount(){
    console.log('HI');
  }
  
  render() {
    
    let timeslots = [
      ['5', '6'], // 1:00 AM - 2:00 AM
      ['6', '7'], // 2:00 AM - 3:00 AM
      ['7', '8'], // 4:00 AM - 6:00 AM
      ['18', '19'],
      ['19', '20'],
      ['20', '21']
    ];
    let selected = {
      startDate: 'July 20th 2020, 7:00:00 AM',
      endDate: 'July 20th 2020, 8:00:00 AM',
  };
  
    return (
      <div>
        {/* <Header/> */}
      
      <ReactTimeslotCalendar
        initialDate={moment().format()}
        timeslots={timeslots}
        onSelectTimeslot={this.onSelectTimeslot(timeslots,selected )}  
      />
     
      <Footer/>
      </div>
    );
  }
}

